import Fullpage from "@fullpage/react-fullpage";
import './App.css';

function App() {
  return (
      <div>
        <Fullpage
            color
            render={()=>(
                <Fullpage.Wrapper>
                  <div className={"section"}>
                    <div className={"box"}>
                        <p>YEONHO JEONG</p>
                        <p>Creative Developer, Turn your thinking!</p>
                        <p></p>
                    </div>
                  </div>
                  <div className={"section"}>
                    <p>ㅎㅇ2</p>
                  </div>
                </Fullpage.Wrapper>
            )}
        />
      </div>
  );
}

export default App;
